he socialist revolution, the rights of Chinese women have been written into the country's constitution. Under Mao, unprecedented numbers of women joined the workforce and they were celebrated as \\\"\\\"iron girls.\\\"\\\"\\n\\nBut now, China is home to a fifth of the worlds women whose status as equals is dwindling. Domestic violence rates in the country have soared, marital rape is not considered a crime, those who dare to call themselves feminist activists are being detained by the government, and unmarried women older than 27 are commonly referred to as \\\"\\\"leftover women.\\\"\\\" \\n\\nTo find out what lies behind the drastic shift in womens social status in China, we track down feminist scholar and \\\"\\\"iron girl\\\"\\\" Wang Zheng and spend a day with one of Chinas so-called leftover women. We also explore the extremes of China's wedding industry and its defectors before meeting Wei Tingting, one of the five women's rights activists detained for trying to start a campaign against sexual harassment on public transportation.\\n\\nClick here to SUBSCRIBE to VICE Asia: https:\/\/bit.ly\/2LhqAR9\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/WBMcoJWo92Y\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLCWSi86fu_dtDmbjOfTqK8n41j6AA\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/WBMcoJWo92Y\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLBq4aOqAtpnpi8dybaKXJ2YkYTfpA\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/WBMcoJWo92Y\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLBPs1t-wkLiQAy3JhWirAcXKQae2g\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/WBMcoJWo92Y\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLC9V_VMZTPzg0_49UVh6_QssmHGiA\",\"width\":336,\"height\":188},{\"url\":\"https:
